INSERT INTO `ps_category_lang` VALUES (1,1,1,'Baza','','baza','','',''),(2,1,1,'Strona główna','','strona-glowna','','',''),(3,1,1,'Kursy FRONT-END','<p>Jeśli kupisz kurs stacjonarny lub weekendowy, a będą wymagały tego okoliczności to umożliwimy Ci udział w zajęciach poprzez tryb Wirtualnej Klasy. Zajęcia będą prowadzone w ustalonych dniach i godzinach oraz “live” z wykładowcami i grupą.Wykorzystaj czas, wybierz kurs dla siebie i wejdź do świata IT!</p>','kursy-front-end','','',''),(4,1,1,'Kursy ZDALNE','<p>Jeśli kupisz kurs stacjonarny lub weekendowy, a będą wymagały tego okoliczności to umożliwimy Ci udział w zajęciach poprzez tryb Wirtualnej Klasy. Zajęcia będą prowadzone w ustalonych dniach i godzinach oraz “live” z wykładowcami i grupą.Wykorzystaj czas, wybierz kurs dla siebie i wejdź do świata IT!</p>','kursy-zdalne','','',''),(5,1,1,'Black Friday 2021','<p>W ramach Black Friday otrzymasz od nas:- 3 000 zł zniżki na kursy programistyczne w pakiecie Premium z kodem BF3000,- 2 000 zł zniżki na kursy programistyczne w pakiecie Profesjonalnym z kodem BF2000,- 1 000 zł zniżki na kursy programistyczne w pakiecie Podstawowym z kodem BF1000,- 500 zł zniżki na kurs testerski we wszystkich pakietach z kodem BF500.</p>','black-friday-2021','','',''),(6,1,1,'Kursy IT','<p>Jeśli kupisz kurs stacjonarny lub weekendowy, a będą wymagały tego okoliczności to umożliwimy Ci udział w zajęciach poprzez tryb Wirtualnej Klasy. Zajęcia będą prowadzone w ustalonych dniach i godzinach oraz “live” z wykładowcami i grupą.Wykorzystaj czas, wybierz kurs dla siebie i wejdź do świata IT!</p>','kursy-it','','',''),(7,1,1,'Kursy BACK-END','<p>Jeśli kupisz kurs stacjonarny lub weekendowy, a będą wymagały tego okoliczności to umożliwimy Ci udział w zajęciach poprzez tryb Wirtualnej Klasy. Zajęcia będą prowadzone w ustalonych dniach i godzinach oraz “live” z wykładowcami i grupą.Wykorzystaj czas, wybierz kurs dla siebie i wejdź do świata IT!</p>','kursy-back-end','','',''),(8,1,1,'Kursy dla średnio zaawansowanych','<p>Jeśli kupisz kurs stacjonarny lub weekendowy, a będą wymagały tego okoliczności to umożliwimy Ci udział w zajęciach poprzez tryb Wirtualnej Klasy. Zajęcia będą prowadzone w ustalonych dniach i godzinach oraz “live” z wykładowcami i grupą.Wykorzystaj czas, wybierz kurs dla siebie i wejdź do świata IT!</p>','kursy-dla-srednio-zaawansowanych','','',''),(17,1,1,'Wszystkie kursy','<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:16px;background-color:#ffffff;\">Jeśli kupisz kurs stacjonarny lub weekendowy, a będą wymagały tego okoliczności to umożliwimy Ci udział w zajęciach poprzez tryb </span><a href=\"https://coderslab.pl/pl/kurs-zdalny\" target=\"_blank\" style=\"background-color:#ffffff;color:#000000;font-family:arial, helvetica, sans-serif;font-size:16px;\" rel=\"noreferrer noopener\"><span style=\"font-weight:600;color:#292929;\"><i>Wirtualnej Klasy</i></span></a><span style=\"font-family:arial, helvetica, sans-serif;font-size:16px;background-color:#ffffff;\">. Zajęcia będą prowadzone w ustalonych dniach i godzinach oraz “live” z wykładowcami i grupą.<br /></span><span style=\"font-family:arial, helvetica, sans-serif;font-size:16px;background-color:#ffffff;\"><br /></span><span style=\"font-weight:600;color:#292929;font-family:arial, helvetica, sans-serif;font-size:16px;background-color:#ffffff;\">Wykorzystaj czas, wybierz kurs dla siebie i wejdź do świata IT!</span></p>','wszystkie-kursy','','','');
