INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','','Nasze warunki i możliwości dostaw','warunki, dostawa, kurier, paczka','<h3>Krzysztof Winkiewicz</h3>\n<h2>Dostawa</h2>\n<p></p>\n<p>Zastanówmy się tu razem,<br />produkt bierzesz, bez wahania,<br />unikasz w kolejce stania,<br />potem tylko dwuklik jeden, <br />potem może jeszcze siedem,<br />potem jeszcze ze dwa sklepy,<br />potem jeszcze trzy palety,<br />potem może... jakiś mebel...<br />potem... wiem, o! mały knebel,<br />siedemdziesiąt trzy parówki!<br />no i montaż do kablówki,<br />trzy sandały, dwa kozaki,<br />do ogródka jakieś krzaki,<br />coś dla żony, coś dla brata,<br />nowe auto co wymiata...<br /><br />Następnego dnia, już rano<br />Podliczamy zbędne siano,<br />przez okienko sobie zerkasz,<br />gryząc małego cukierka...<br /><br />Na podwórku wielki raban!<br />Kontenerów pełen stragan,<br />Samoloty też zrzucają.<br />paczki co się nie turlają<br /><br />I tak sobie pomyśl żywo,<br />jak na jedne twe zakupy,<br />w cieniu Twej małej kajuty<br />ile poszło na paliwo,<br />ile spalin, ile smogu...<br />Szkoda gadać</p>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','nota, prawna, zasady','<h3>Krzysztof Winkiewicz</h3>\n<h2>Nota prawna</h2>\n<p></p>\n<p>Już w królestwie międzyrzecza<br />jak się jeden z drugim sprzecza<br />Hammurabi tak orzecza:</p>\n<p><br />są zasady, drodzy moi,<br />pewnych rzeczy nie przystoi,<br />jak się co niektóry boi,<br />niechaj się tak zastanowi:</p>\n<p><br />co ja zrobię, gdy bez prawa<br />kupię wino, a tam kawa,<br />albo gorzej, płynna trawa!</p>\n<p><br />Czy ja wówczas, sam niestety<br />przed obliczem mej kobiety,<br />będę miał na tyle krzepy,<br />by tłumaczyć się, o rety!?</p>\n<p><br />Prawo, widzisz, ważna sprawa,<br />spawiedliwa i chytrawa,<br />Jendak gdy o interesach mowa,<br />jego waga jest kluczowa</p>','nota-prawna'),(3,1,1,'Warunki użytkowania','','Nasze warunki użytkowania','warunek, użytek, użytkowanie','<h2>Nieanonimowa muza</h2>\n<h3>Warunki użytkowania</h3>\n<p></p>\n<p>Bardzo dobrze, Czytelniku,<br />Że w to miejsce zawitałeś!<br />Tutaj dowiesz się wszystkiego<br />(Niekoniecznie tego chciałeś?)<br /><br />Trudno - witaj w naszym cyrku!<br />Choć nie będzie aż tak śmiesznie<br />Bo to rzecz o konsekwencjach<br />Gdy się klika zbyt pospiesznie<br /><br />Co się wtedy dzieje? Smyku!<br />Och, to każdy by się trwożył<br />Bo jeżeli błąd popełnisz<br />To pod topór się podłożysz!<br /><br />Jaki topór?! Mówię - bany!<br />Bany i konta blokada!<br />Za komentarz obraźliwy<br />Cóż - blokować wręcz wypada.<br /><br />Więc pamiętaj, Czytelniku,<br />w internecie są zasady<br />I stosować się tu trzeba -<br />Takie życie, nie ma rady!</p>','warunki-uzytkowania'),(4,1,1,'O nas','','Dowiedz się więcej o nas','o nas, informacje','<h2>Krzysztof Winkiewicz</h2>\n<h3>O nas</h3>\n<p></p>\n<p>Co dzień po Gdańskich alejach<br />włóczą się ludzie w autach i kolejach<br />Wstają co rano uczelnię nadwiedzają<br />nie pojmują czemu pianin nie nastrajają.<br />Budują sklepy, symulują księstwa,<br />pokaz siły, cierpliwości i męstwa.<br />A mimo to jeden kaprys starczy<br />i studenta kolejnym rokiem Kubale obarczy...</p>','o-nas'),(5,1,1,'Bezpieczne płatności','','Nasze metody bezpiecznej płatności','ssl, visa, mastercard, paypal, bezpieczne płatności','<h2>Nieanonimowa muza</h2>\n<h3>Bezpieczne płatności</h3>\n<p></p>\n<p>Co to znaczy? O co chodzi?<br />Pewnie chciałbyś się dowiedzieć<br />Przede wszystkim - sprawdzaj zawsze<br />czy link wprost do banku wiedzie.<br /><br />Czy w adresie literówki<br />Ani jednej nie uświadczysz<br />I czy po \"ha-te-te-pe\"<br />\"Eska\" stoi - jak na baczność!<br /><br />A jeżeli, Proszę Państwa,<br />Będę płacić przy odbiorze?<br />Ręce umyj, dobrze, schludnie,<br />i płać kartą, jeśli możesz!</p>','bezpieczne-platnosci');
