INSERT INTO `ps_product_lang` VALUES (1,1,1,'Ogólne Warunki Umowy - zapoznaj się ze szczegółowymi warunkami udziału w kursie<br />Szczegółowy program kursu - zobacz jakie zagadnienia będą poruszane w każdym tygodniu kursu<br /><br />Pamiętaj! Miesiąc przed startem kursu udostępnimy Ci tzw. prework czyli materiały przygotowujące do głównej części kursu. Zapoznasz się z systemami i technologiami, z jakimi będziesz miał kontakt podczas kursu oraz otrzymasz pierwsze zadania. Przygotujesz również swój komputer do zajęć, dzięki czemu nie będzie tracił na to czasu w trakcie zajęć. <br />Na prework zarezerwuj 60 godzin. Dostęp do niego otrzymasz miesiąc przed kursem od Opiekuna Kursu, który skontaktuje się z Tobą po dokonaniu zakupu.<br /><br /><br />Nasz bestseller! <br />Na tym kursie nauczysz się programować tę część stron internetowych i aplikacji webowych, którą użytkownicy widzą w przeglądarce. W uporządkowany sposób przekażemy Ci podstawy programowania w języku JavaScript i używania biblioteki React. <br /><br />Za kurs możesz zapłacić na trzy sposoby:<br /><br /><br />Płatność jednorazowa - brak dodatkowych opłat, możliwość płatności kartą lub przelewem. <br /><br /><br />Raty PayU 0% - nieoprocentowane raty PayU, dzięki którym nie ponosisz żadnych dodatkowych kosztów. Płatność za kurs możesz podzielić na 3,5,6, lub 10 rat. <br /><br /><br />Niskie Raty PayU już od 356 zł - możliwość podzielenia płatności za kurs nawet na 36 rat. Oprocentowanie zależy od liczby rat i zaczyna się już od 6,5%.Sprawdź wysokość rat dla Twojego kursu: kalkulator rat PayU<br /><br /><br />TRYBY NAUKI<br />Kurs możesz odbyć w dwóch trybach:<br /><br /><br />Dziennym<br /><br />Zajęcia odbywają się zdalnie od poniedziałku do piątku w godzinach 9:00-17:00. <br /><br />Weekendowym<br /><br />Zajęcia odbywają się zdalnie co drugi tydzień w soboty i niedziele w godzinach 9:00-17:00.<br /> <br />PAKIETY CENOWE<br /><br />W ramach kursu możesz wybrać jeden z trzech pakietów cenowych. Każdy z nich realizuje inne potrzeby kursanta i dlatego zawiera inną liczbę godzin nauki oraz różne elementy składowe. Wybierz pakiet najlepszy dla siebie.<br /><br /><br />Pakiet podstawowy – dla chcących zdobyć nowe kompetencje<br /><br />Odpowiedni wybór dla tych, którzy nie szukają pracy po kursie, a jedynie chcą zdobyć umiejętności uzupełniające ich obecne kompetencje.<br /><br /><br />Pakiet profesjonalny – dla myślących o zmianie pracy<br /><br />Skutecznie przygotujemy Cię do wymagającego procesu rekrutacji w nowej branży. Zdobędziesz więcej kompetencji i praktycznych umiejętności, dzięki czemu będziesz miał szansę wyróżnić się wśród innych kandydatów na rynku.<br /><br /><br />Pakiet premium – dla chcących zyskać przewagę na rynku pracy<br /><br />Pakiet zawiera wszystkie elementy z niższych pakietów oraz dodatkowo moduł Full-Stack (połączenie technologii back-end i front-end). Ten wybór pozwoli Ci aplikować na bardziej wymagające stanowiska.<br /><br />Pakiet Pewna Praca – dla chcących szybko i sprawnie wejść do branży<br /><br />Wejdź do IT do 6 miesięcy po kursie! W pakiecie otrzymujesz indywidualne wsparcie wykładowcy i praktyka z branży oraz doradcy kariery. Dodatkowo zrobisz międzynarodowy certyfikat Scrum Developer Certified (SDC™️) i zyskasz pierwszeństwo w poleceniach do firm partnerskich.<br />','','darmowy-produkt','','','','JavaScript Developer','','','',''),(2,1,1,'Szczegółowy program kursu - zobacz, jakie zagadnienia będą poruszane w każdym tygodniu kursu<br />Ogólne Warunki Umowy - zapoznaj się ze szczegółowymi warunkami udziału w kursiePamiętaj! 2 tygodnie przed startem kursu udostępnimy Ci tzw. prework czyli materiały przygotowujące do głównej części kursu. Zapoznasz się z podstawowymi zagadnieniami testerskimi, z którymi później będziesz miał do czynienia podczas kursu. Na prework zarezerwuj 40 godzin. Dostęp do niego otrzymasz 2 tygodnie przed kursem od Opiekuna Kursu, który skontaktuje się z Tobą po dokonaniu zakupu. <br /><br /><br />Najkrótszy i najmniej intensywny z naszych kursów. Przygotuje Cię do zawodu Testera Manualnego. Zapewni Ci szybkie wejście do branży IT ponieważ testerzy są niezastąpieni w każdym zespole programistycznym. W trakcie kursu Testera Manualnego zdajesz egzamin, którego wynikiem jest otrzymanie niezależnego, międzynarodowe certyfikatu ISTQB. Dzięki niemu zdecydowanie łatwiej będzie Ci znaleźć pracę w zawodzie. W trakcie kursu nauczysz się metodologii i narzędzi przeprowadzania testów oprogramowania, które weryfikują czy działa ono zgodnie z wymaganiami klienta.<br />Za kurs możesz zapłacić na trzy sposoby:<br />Płatność jednorazowa - brak dodatkowych opłat, możliwość płatności kartą lub przelewem. <br />Raty PayU 0% - nieoprocentowane raty PayU, dzięki którym nie ponosisz żadnych dodatkowych kosztów. Płatność za kurs możesz podzielić na 3,5,6, lub 10 rat. <br />Niskie Raty PayU już od 193 zł - możliwość podzielenia płatności za kurs nawet na 36 rat. Oprocentowanie zależy od liczby rat i zaczyna się już od 6,5%.Sprawdź wysokość rat dla Twojego kursu: kalkulator rat PayU.<br />TRYBY NAUKI<br />Kurs możesz odbyć w trzech trybach:<br />Stacjonarnym<br />Zajęcia odbywają się od poniedziałku do piątku w godzinach 9:00-17:00 w siedzibie Coders Lab. <br />Weekendowym<br />Zajęcia odbywają się co drugi tydzień w soboty i niedziele w godzinach 9:00-17:00 w siedzibie Coders Lab.<br />Zdalnym<br />Kurs odbywa się zdalnie z dowolnego miejsca, wystarczy dostęp do internetu. 50% godzin kursu to zajęcia zdalne z wykładowcą i grupą w wirtualnej klasie. Zajęcia odbywają się wieczorami i w weekendy w godzinach 18:30-21:30. Pozostałe 50% godzin kursu to nauka własna. <br />PAKIETY CENOWE<br />W ramach kursu możesz wybrać jeden z trzech pakietów cenowych. Każdy z nich realizuje inne potrzeby kursanta i dlatego zawiera inną liczbę godzin nauki oraz różne elementy składowe. Wybierz pakiet najlepszy dla siebie.<br />Pakiet podstawowy – dla chcących zdobyć nowe kompetencje<br />Odpowiedni wybór dla tych, któr